import React from "react";
// import { Link } from "react-router-dom";
import logoImg from "../../../img/logo.png";
import { SearchIcon } from "@heroicons/react/solid";

export default function Header() {
  return (
    <div>
      <header className="flex w-full bg-white p-2">
        <div className="mx-4">
          <img src={logoImg} alt="" className="2-8 h-8" />
        </div>
        <form action="" className="bg-reddit_gray-800 p-1 flex rounded-md">
          {/* <SearchIcon className="text-gray-300 h-7-w-7" /> */}
          <svg
            xmlns="http://www.w3.org/2000/svg"
            fill="none"
            viewBox="0 0 24 24"
            stroke-width="1.5"
            stroke="currentColor"
            class="w-6 h-6"
          >
            <path
              stroke-linecap="round"
              stroke-linejoin="round"
              d="M21 21l-5.197-5.197m0 0A7.5 7.5 0 105.196 5.196a7.5 7.5 0 0010.607 10.607z"
            />
          </svg>

          <input type="text" className="bg-reddit_light_gray h-8" />
        </form>
      </header>
    </div>
